import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import configureStore from './store/store.js';
import { addExpense, removeExpense } from './actions/expenses.js';
import { setTextFilter } from './actions/filters.js';
import getFilteredExpenses from './helpers/sort.js';

const store = configureStore();


store.dispatch(addExpense({ id: 1, type: 'Water\'s bill', description: 'This month\'s water bill ', amount: 2000, createdAt: 0 }));
store.dispatch(addExpense({ id: 2, type: 'Gas Bill', description: 'The last gas bill', amount: 2000, createdAt: 0 }));
store.dispatch(setTextFilter('bill'));
store.dispatch(setTextFilter('gas'));

ReactDOM.render(<App />, document.getElementById('root'));
// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
